#include <stdio.h>
#include <stdlib.h>
#include <string.h>


int main() {
    char buffer[8000];
    char data[] = "";
    size_t datalen = strlen(data);
    int i = 0;
    for (; i<16; i++) {
        int s = 0;
        for (; s<datalen; s++) {
            buffer[s] = data[s] ^ data[s+i];
        }
        int t = 0;
        double same = 0;
        for (; t<datalen; t++) {
            if (buffer[t] == data[t]) {
                same++;
            }
        }
        printf("%d: %f\n", i, (same / datalen));
    }

    return 0;
}
